/*
 * 06/04/2020
    > Permettre de trier une liste par intitulé (plutôt que par cote)

08/04/2020
    > La barre de recherche rapide fait désormais une recherche tous mots si le texte saisi n'est ni un code barre exe ou lecteur ni un EAN
    > Simplification des recherches (plus de recherche simple)
    > Anonymisation des prêts (6 mois après date de retour) et des lecteurs (1 ans après fin abonnement)
      ATTENTION : il faut exporter les paniers prêts
    > Affichage unimarc en clair
