      ATTENTION : nécessitera impérativement une réindexation de la table biblio (sinon plus rien ne sera exporté vers Bokeh)
    > Création d'un nouveau statut "non accessible à la recherche publique"
    > Correction du bug #241 : quand on importe une notice avec l'option "remplacer les exemplaires existants" il modifie aussi les autres exemplaires
    > corerction bugs #163 & #93 : impossible d'imprimer ou enregistrer une liste quand on n'est pas sur la page 1
    > Correstion bug : quand on force le prêt d'une réservation réservée, son statut reste "en rayon" (donc à aller chercher en rayon)
    > Possibilité de supprimer une résa via Bokeh (sauf si la résa est déjà affectée)
    > Possibilité de prolonger un prêt via Bokeh
